    private int min = Integer.MAX_VALUE;
    private int max = Integer.MIN_VALUE;
    
    public int[] shortestSeqTimeout(int[] big, int[] small) {
        Map<Integer, Boolean> map = new HashMap<>();
        Set<Integer> set = new HashSet<>();
        for (int i = 0; i < small.length; i++) {
            map.put(small[i], false);
        }
        int len = Integer.MAX_VALUE;
        int[] res = new int[2];
        for (int start = 0; start < big.length; start++) {
            if (map.containsKey(big[start]) && !map.get(big[start])) {
                map.replace(big[start], true);
                set.add(big[start]);
                for (int end = start; end < big.length; end++) {
                    if (map.containsKey(big[end]) && !map.get(big[end])) {
                        set.add(big[end]);
                        map.replace(big[end], true);
                    }
                    if (set.size() == small.length && end - start < len) {
                        len = end - start;
                        res[0] = start;
                        res[1] = end;
                        start = end - 1;
                    }
                }
                map.replaceAll((k, v) -> Boolean.FALSE);
                set.clear();
            }
        }
        return len == Integer.MAX_VALUE ? new int[] {} : res;
    }
    
    public int[] shortestSeq(int[] big, int[] small) {
        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 0; i < small.length; i++) {
            map.put(small[i], -1);
        }
        int len = Integer.MAX_VALUE;
        int[] res = new int[2];
        for (int i = 0; i < big.length; i++) {
            map.replace(big[i], i);
            if (validateNonNegative(map)) {
                findExtremum(map);
                if (max - min < len) {
                    res[0] = min;
                    res[1] = max;
                    len = max - min;
                    map.replaceAll((k,v)->-1);
                }
            }
        }
        return len == Integer.MAX_VALUE ? new int[] {} : res;
    }
    
    private boolean validateNonNegative(Map<Integer, Integer> map) {
        for (int value : map.values()) {
            if (value == -1) {
                return false;
            }
        }
        return true;
    }
    
    private void findExtremum(Map<Integer, Integer> map) {
        min = Integer.MAX_VALUE;
        max = Integer.MIN_VALUE;
        for (int value : map.values()) {
            max = Math.max(value, max);
            min = Math.min(value, min);
        }
    }
    
    private boolean validateAll(Map<Integer, Boolean> map) {
        for (boolean value : map.values()) {
            if (!value) {
                return false;
            }
        }
        return true;
    }
    
